            <div className="container" >
                <h1 className="BigHeadingFont">
                    Hi! I'm Rashu <br></br>
                    and I'm a Certified <br></br>
                    Health Nutritionist
                </h1> <br></br><br></br>
                <h4>MY MISSION IS TO HELP YOU BALANCE YOUR HORMONES AFTER COMING OFF BIRTH CONTROL</h4>
            </div>
        </div>
    );
}

export default BigHeading;
